class FABS:
    def __init__(self):
        self.clusters = {}

    def add_cluster(self, cluster_id):
        self.clusters[cluster_id] = Cluster(cluster_id)

    def add_user_story_to_cluster(self, cluster_id, user_story):
        if cluster_id in self.clusters:
            self.clusters[cluster_id].add_user_story(user_story)
        else:
            print(f"Cluster {cluster_id} does not exist.")

    def process_clusters(self):
        for cluster in self.clusters.values():
            print(f"Processing cluster {cluster.cluster_id}:")
            cluster.process_user_stories()

# Main Execution
